import React from 'react'

function Navbar(props){
    const handleClick = () => {
        console.log(props)
        return props.history.push('/post')
    }
    return (
        <div className="bg-gray-500 h-16 w-full z-10 fixed ">
            <h1 className="p-3 font-bold text-blue-200 text-2xl float-left">rent<span className="text-red-300">R</span></h1>
            <link to='/post' type="button" className="z-20 p-3 mt-2 mr-2 bg-gray-700 rounded text-white float-right"/>
        </div>
    )
}

export default Navbar
